        return (
            <div>
                   <div className='container mt-5'>
                           <div className='row'>
                                 
                                 <div className='imgcorner'>
                                         <div className='container mt-2'>
                                              <h4 className='text-white'>Order Food Online</h4>
                                              <p className='text-white mt-3'>Use code to get 50% off upto $5</p>
                                              <p className='text-white'>on your next order.</p>
                                              <button className='btn btn-warning text-white mb-2'>Order Now</button>
                                         </div>
                                          {/* <img src={img7} alt='error' className='citbox'/> */}
                                         
                                         
                                 </div>
         
                                 <div className='imgcorner imgcornerst'>
                                         <div className='container mt-2'>
                                              <h4 className='text-white'>Membership <i class="fa fa-long-arrow-right"></i> Open Now</h4>
                                              
                                              <p className='text-white'>Memberships are now open for</p>
                                              <p className='text-white'>purchases.</p>
                                              <button className='btn btn-warning text-white mb-2'>Sign Up Now</button>
                                         </div>
                                          {/* <img src={img7} alt='error' className='citbox'/> */}
                                         
                                         
                                 </div>


                                 {/* <div className='right'> */}
                                
                                 {/* <img src={img8} alt='error' className='cisbox pl-4'/> */}
                       
                                  {/* </div> */}
                                 
                                
                                  
                           </div>
                   </div>
<br/>


                   <h3 className='mt-5 text-center'>Quick Searches</h3>
                   <p className='mt-3 text-center'>Discover Restauranrs By Type of Meal</p>
            </div>
        )
    }
}



